! function (t) {
    t(".open-content-1").click(function () {
        t(this).toggleClass("is-active"), t(".content-hidden-1").toggleClass("is-active")
    }), t(".open-content-2").click(function () {
        t(this).toggleClass("is-active"), t(".content-hidden-2").toggleClass("is-active")
    })
}(jQuery);

AOS.init({
  duration: 1000,
})